import React from "react";
import './style.css';
import Slider from "react-slick";
const CatSlider = () => {
    var settings = {
        dots: false,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1,
        fade: true,
        arrows: true,
    };

    return (
        <>
            <div className='catSliderSection'>
                <div className='container-fluid'>
                    <h2 className=''>Featured Categories</h2>
                    <Slider {...settings} className='catSliderMain'>
                    </Slider>
                </div>
            </div>
        </>
    )
}

export default CatSlider
